// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

import "OpenZeppelin/openzeppelin-contracts@4.8.2/contracts/token/ERC721/ERC721.sol";
import "OpenZeppelin/openzeppelin-contracts@4.8.2/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "OpenZeppelin/openzeppelin-contracts@4.8.2/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "OpenZeppelin/openzeppelin-contracts@4.8.2/contracts/access/Ownable.sol";
import "OpenZeppelin/openzeppelin-contracts@4.8.2/contracts/utils/Counters.sol";


// next add require methods or statements to use as restriction peremeters to functions with specific confineds.

contract FundRaiser is ERC721, ERC721Enumerable, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    using Counters for Counters.Counter;
    using Counters for Counters.Counter;
    using Counters for Counters.Counter; // update here
    Counters.Counter private _DonatorsCount;
    Counters.Counter private _PostsCount;
    Counters.Counter private _ActPstCount; // update here
    Counters.Counter private _tokenIdCounter; // Number Of Tokens Created On This Contract

    uint public _TotalDonations;
    uint private _DonationBalance;

    struct Donator{ 
        uint donatorsIdx;  
        address adr;  
        uint amount; 
        uint donCount; // amount of time the user donated    
    }

    struct Post{ 
        uint postIdx;  
        address author;  
        string post;
        string slug; // update here
        uint likecount;     
    }

    struct likeAdrs{
      address user;
      bool liked;
    }

    mapping(uint => mapping(address => likeAdrs)) public PostLikes;

    mapping(uint => Post) public AllPosts;

    mapping(address  => Donator) public AllDonators;

    address[] public DonorsAdrLst; // new update..... 


    //Initiated At first Contract Deployment.
    constructor() ERC721("FundRaiserNFTs", "FRN") { 
          // Initialize the tokenIdCounter to start 1
         _tokenIdCounter.increment();
    }



    // CROWDFUND SECTION
    // checked
    function safeMint(string memory uri) public {
        require(AllDonators[msg.sender].donCount - balanceOf(msg.sender) >= 1, "The Connected account is Not eligible to Mint token"); 
        uint256 tokenId = _tokenIdCounter.current(); // this line and the next assigns a token Id and updates the _tokenIdCounter State Variable.
        _tokenIdCounter.increment();    
        _safeMint(msg.sender, tokenId); // This Line And The Next Two Make's Call's To These Called Function To Complete The Minting Process.
        _setTokenURI(tokenId, uri); 
    }


    // checked updated this....
    function Donate() public payable {
      require(msg.sender != owner(), "Donations Can Not Be Made By The Contract Owner");
      require(msg.value >= (10**18)*2, "Sent Value Below Ninimum Donation");
      payable(owner()).transfer(msg.value);
      _TotalDonations += msg.value;
      _DonationBalance += msg.value;
      if(AllDonators[msg.sender].adr == msg.sender ){
          AllDonators[msg.sender].amount += msg.value;
          AllDonators[msg.sender].donCount +=1;
          return;
      }        
      Donator storage D = AllDonators[msg.sender];
      D.donatorsIdx = _DonatorsCount.current();
      _DonatorsCount.increment();
      D.adr = msg.sender;
      D.amount = msg.value;
      D.donCount +=1;
      DonorsAdrLst.push(msg.sender); // update here.....
      return;
    }

        //Making This Call Will Withdraw Payments Made To The Contract, The Call Could Be Made Only By Contract Owner 
    function TransferDonations(address payable adr) public payable onlyOwner {
        require(msg.sender != adr, "Transfer To Own Account Is Not Valid");
        require(msg.value < _DonationBalance, "Withdrawal Limits Excceded");
        adr.transfer(msg.value);
        _DonationBalance -= msg.value;
    }

    // update here
    function DonorAdr() public view onlyOwner returns (address[] memory)
    {
      address[] memory Adrs = new address[](DonorsAdrLst.length);
      for (uint256 i = 0; i < DonorsAdrLst.length; i++) { // Here We will Be Useing A loop And Some  Called Functions  
        Adrs[i] = DonorsAdrLst[i]; // To Complete The Process i.e Return The Array.
      }
      return Adrs;
    }    

      // checked
    function _donationtBalance() public onlyOwner view returns( uint ){
        // require(msg.sender == owner(), "You are not Authorized to make this Request");
        return _DonationBalance;
    }  

    // checked
    //Making This Call Returns A fixed Array Containing Every Token Associated With The Caller
    function OwnWallet()public view returns (uint256[] memory)
    {
      uint256 ownerTokenCount = balanceOf(msg.sender);
      uint256[] memory tokenIds = new uint256[](ownerTokenCount);
      for (uint256 i = 0; i < ownerTokenCount; i++) { // Here We will Be Useing A loop And Some  Called Functions  
        tokenIds[i] = tokenOfOwnerByIndex(msg.sender, i); // To Complete The Process i.e Return The Array.
      }
      return tokenIds;
    }


    // BLOG SECTION
    // checked
    function NewPost(string memory post, string memory slug) public{
      require(bytes(post).length > 0, "Invalid Post");
      Post storage P = AllPosts[_PostsCount.current()];
      P.postIdx = _PostsCount.current();
      P.author = msg.sender;
      P.post = post;
      P.slug = slug; // update here.
      _PostsCount.increment();
      _ActPstCount.increment();      
    }

    // checked new update.....
    function LikeandUnlikePost(uint postId) public{
      require(AllPosts[postId].postIdx == postId, "Invalid Post Do Not Exist");
      if(PostLikes[postId][msg.sender].user == msg.sender){
         if(PostLikes[postId][msg.sender].liked ==  true){
            PostLikes[postId][msg.sender].liked = false;
            AllPosts[postId].likecount -= 1;
            return;
         }
          PostLikes[postId][msg.sender].liked = true;
          AllPosts[postId].likecount += 1;
          return;
        }
      AllPosts[postId].likecount += 1;
      likeAdrs storage l = PostLikes[postId][msg.sender];
      l.user = msg.sender;
      l.liked = true;
      return;
    }

    // checked
    function ReturnLiked(uint postId) public view returns (bool)
    {
      require(AllPosts[postId].postIdx == postId, "invalid Post Do Not Exist");
      // require(PostLikes[postId][msg.sender].user == msg.sender, "Invalid account or Account Has'nt Liked Post Yet"); update here
      if (PostLikes[postId][msg.sender].user != msg.sender){
          return false;
      }  
      bool Liked = PostLikes[postId][msg.sender].liked;
      return Liked;
    }


    // checked
    function DeletePost(uint postId) public{
      require(AllPosts[postId].postIdx == postId, "Invalid.. Post Does Not Exist");
      require(AllPosts[postId].author == msg.sender, "Account Unathurized To Delete Post");
      delete AllPosts[postId];
      _ActPstCount.decrement();
    }


    // checked
    function ReturnPosts() public view returns (Post[] memory)
    { 
      uint idx = 0;
      Post[] memory Posts = new Post[](_ActPstCount.current());
      for (uint i = 0; i < _PostsCount.current(); i++) { // Here We will Be Useing A loop And Some  Called Functions
            if(bytes(AllPosts[i].post).length > 0){
                Posts[idx] = AllPosts[i];
                idx++;
            }    // To Complete The Process i.e Return The Array.
      }
      return Posts;
    }

    // The following functions are overrides required by Solidity.
    function _beforeTokenTransfer(address from, address to, uint256 tokenId, uint256 batchSize)
      internal
      override(ERC721, ERC721Enumerable)
    {
      super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function supportsInterface(bytes4 interfaceId)
      public
      view
      override(ERC721, ERC721Enumerable)
      returns (bool)
    {
      return super.supportsInterface(interfaceId);
    }

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
      super._burn(tokenId);

    }
    // Returns The Token URI Of The Requested Token.
    function tokenURI(uint256 tokenId)
      public
      view
      virtual
      override(ERC721, ERC721URIStorage)
      returns (string memory)
    {
      require(
        _exists(tokenId),
        "ERC721Metadata: URI query for nonexistent token"
      );

        return super.tokenURI(tokenId);

    }  

}
